  salinity and other variables collected from discrete sample and profile observations
  using CTD, bottle and other instruments from the KNORR in the Andaman Sea or Burma
  Sea, Arabian Sea and others from 1994-12-01 to 1996-01-23 (NODC Accession 0115009)\",\n\t\"tracking_summary\":
