  [],\n\t\"revision_timestamp\": \"2015-09-26T23:32:07.815474\",\n\t\"name\": \"partial-pressure-or-fugacity-of-carbon-dioxide-dissolved-inorganic-carbon-alkalinity-temperatura5f0d\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115009 includes chemical,
  discrete sample, physical and profile data collected from KNORR in the Andaman Sea
  or Burma Sea, Arabian Sea, Bay of Bengal, Gulf of Aden, Gulf of Oman, Indian Ocean,
  Laccadive Sea, Mozambique Channel and Persian Gulf (Gulf of Iran) from 1994-12-01
  to 1996-01-23 and retrieved during cruise WOCE_I01E, WOCE_I01W, WOCE_I02E, WOCE_I02W,
  WOCE_I03, WOCE_I05WI04, WOCE_I07N, WOCE_I08NI05E, WOCE_I08SI09S, WOCE_I09N and WOCE_I10.
  These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113
  (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DELTA CARBON-13,
  DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM,
  HYDROSTATIC PRESSURE, NEON, NITRATE, NITRITE, PHOSPHATE, Partial pressure (or fugacity)
  of carbon dioxide, Potential temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen
  isotope) and WATER TEMPERATURE. The instruments used to collect these data include
  CTD and bottle. These data were collected by Kenneth Johnson of Brookhaven National
  Laboratory, Christopher D. Winn of Hawaii Pacific University, Robert M. Key of Princeton
  University; Department of Geosciences; Program in Atmospheric and Ocean Sciences,
  Frank J. Millero of Rosenstiel School of Marine and Atmospheric Science, Christopher
  Sabine of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory, Douglas Wallace
  of Universitat Kiel; Institut Fur Meereskunde; Forschungsbereich Marine Biogeochemie
  and Catherine Goyet of University of Perpignan via Domitia; Institute of Modeling
  and Analysis of Geo-Environment and Health as part of the WOCE_I01E, WOCE_I01W,
  WOCE_I02E, WOCE_I02W, WOCE_I03, WOCE_I05WI04, WOCE_I07N, WOCE_I08NI05E, WOCE_I08SI09S,
  WOCE_I09N and WOCE_I10 data set.nnThe World Ocean Circulation Experiment (WOCE)
  was a major component of the World Climate Research Program with the overall goal
  of better understanding the ocean's role in climate and climatic changes resulting
  from both natural and anthropogenic causes. The CO2 survey took advantage of the
  sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
  this period between 1990 and 1998. The final collection covers approximately 23,000
  stations from 94 WOCE cruises.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
